codewiki.cli.config_manager.ConfigManage.source_code:
class ConfigManager:
    """
    Manages CodeWiki configuration with secure keyring storage for API keys.

    Storage:
        - API key: System keychain via keyring (macOS Keychain, Windows Credential Manager, 
                  Linux Secret Service)
        - Other settings: ~/.codewiki/config.json
    """

    def __init__(self):
        """Initialize the configuration manager."""
        self._api_key: Optional[str] = None
        self._config: Optional[Configuration] = None
        self._keyring_available = self._check_keyring_available()

    def _check_keyring_available(self) -> bool:
        """Check if system keyring is available."""
        try:
            # Try to get the current backend
            backend = keyring.get_keyring()
            backend_name = backend.__class__.__name__

            # Check if it's a real backend (not null or fail)
            if 'fail' in backend_name.lower() or 'null' in backend_name.lower():
                return False

            # Try to get/set a test value
            keyring.get_password(KEYRING_SERVICE, "__test__")
            return True
        except (KeyringError, Exception):
            return False

    def load(self) -> bool:
        """
        Load configuration from file and keyring.

        Returns:
            True if configuration exists, False otherwise
        """
        # Load from JSON file
        if not CONFIG_FILE.exists():
            return False

        try:
            content = safe_read(CONFIG_FILE)
            data = json.loads(content)

            # Validate version
            if data.get('version') != CONFIG_VERSION:
                # Could implement migration here
                pass

            self._config = Configuration.from_dict(data)

            # Load API key from keyring or fallback file
            if self._keyring_available:
                try:
                    self._api_key = keyring.get_password(KEYRING_SERVICE, KEYRING_API_KEY_ACCOUNT)
                except KeyringError:
                    pass

            # Fallback: try to load from credentials file
            if self._api_key is None and CREDENTIALS_FILE.exists():
                try:
                    encoded_key = safe_read(CREDENTIALS_FILE).strip()
                    self._api_key = base64.b64decode(encoded_key).decode('utf-8')
                except Exception:
                    # If decoding fails, file may be corrupted
                    pass

            return True
        except (json.JSONDecodeError, FileSystemError) as e:
            raise ConfigurationError(f"Failed to load configuration: {e}")

    def save(
        self, 
        api_key: Optional[str] = None,
        base_url: Optional[str] = None,
        main_model: Optional[str] = None,
        cluster_model: Optional[str] = None,
        fallback_model: Optional[str] = None,
        default_output: Optional[str] = None
    ):
        """
        Save configuration to file and keyring.

        Args:
            api_key: API key (stored in keyring)
            base_url: LLM API base URL
            main_model: Primary model
            cluster_model: Clustering model
            fallback_model: Fallback model
            default_output: Default output directory
        """
        # Ensure config directory exists
        try:
            ensure_directory(CONFIG_DIR)
        except FileSystemError as e:
            raise ConfigurationError(f"Cannot create config directory: {e}")

        # Load existing config or create new
        if self._config is None:
            if CONFIG_FILE.exists():
                self.load()
            else:
                self._config = Configuration(
                    base_url="",
                    main_model="",
                    cluster_model="",
                    fallback_model="glm-4p5",
                    default_output="docs"
                )

        # Update fields if provided
        if base_url is not None:
            self._config.base_url = base_url
        if main_model is not None:
            self._config.main_model = main_model
        if cluster_model is not None:
            self._config.cluster_model = cluster_model
        if fallback_model is not None:
            self._config.fallback_model = fallback_model
        if default_output is not None:
            self._config.default_output = default_output

        # Validate configuration
        self._config.validate()

        # Save API key to keyring or fallback file
        if api_key is not None:
            self._api_key = api_key

            if self._keyring_available:
                try:
                    keyring.set_password(KEYRING_SERVICE, KEYRING_API_KEY_ACCOUNT, api_key)
                except KeyringError:
                    # Keyring failed, fall back to file storage
                    self._keyring_available = False

            # Fallback: save to encoded file if keyring unavailable
            if not self._keyring_available:
                try:
                    # Encode the API key (basic obfuscation)
                    encoded_key = base64.b64encode(api_key.encode('utf-8')).decode('utf-8')
                    safe_write(CREDENTIALS_FILE, encoded_key)
                    # Set restrictive permissions (owner read/write only)
                    CREDENTIALS_FILE.chmod(0o600)
                except FileSystemError as e:
                    raise ConfigurationError(
                        f"Failed to save API key: {e}\n"
                        f"Please check file permissions in {CONFIG_DIR}"
                    )

        # Save non-sensitive config to JSON
        config_data = {
            "version": CONFIG_VERSION,
            **self._config.to_dict()
        }

        try:
            safe_write(CONFIG_FILE, json.dumps(config_data, indent=2))
        except FileSystemError as e:
            raise ConfigurationError(f"Failed to save configuration: {e}")

    def get_api_key(self) -> Optional[str]:
        """
        Get API key from keyring or fallback file.

        Returns:
            API key or None if not set
        """
        if self._api_key is None:
            # Try keyring first
            if self._keyring_available:
                try:
                    self._api_key = keyring.get_password(KEYRING_SERVICE, KEYRING_API_KEY_ACCOUNT)
                except KeyringError:
                    pass

            # Fallback: try credentials file
            if self._api_key is None and CREDENTIALS_FILE.exists():
                try:
                    encoded_key = safe_read(CREDENTIALS_FILE).strip()
                    self._api_key = base64.b64decode(encoded_key).decode('utf-8')
                except Exception:
                    pass

        return self._api_key

    def get_config(self) -> Optional[Configuration]:
        """
        Get current configuration.

        Returns:
            Configuration object or None if not loaded
        """
        return self._config

    def is_configured(self) -> bool:
        """
        Check if configuration is complete and valid.

        Returns:
            True if configured, False otherwise
        """
        if self._config is None:
            return False

        # Check if API key is set
        if self.get_api_key() is None:
            return False

        # Check if config is complete
        return self._config.is_complete()

    def delete_api_key(self):
        """Delete API key from keyring and fallback file."""
        # Try to delete from keyring
        try:
            keyring.delete_password(KEYRING_SERVICE, KEYRING_API_KEY_ACCOUNT)
        except KeyringError:
            pass

        # Delete fallback credentials file
        if CREDENTIALS_FILE.exists():
            try:
                CREDENTIALS_FILE.unlink()
            except Exception:
                pass

        self._api_key = None

    def clear(self):
        """Clear all configuration (file and keyring)."""
        # Delete API key from keyring
        self.delete_api_key()

        # Delete config file
        if CONFIG_FILE.exists():
            CONFIG_FILE.unlink()

        self._config = None
        self._api_key = None

    @property
    def keyring_available(self) -> bool:
        """Check if keyring is available."""
        return self._keyring_available

    @property
    def config_file_path(self) -> Path:
        """Get configuration file path."""
        return CONFIG_FILE

