def check_writable(path: Path) -> bool:
    """
    Check if a path is writable.

    Args:
        path: Path to check

    Returns:
        True if writable, False otherwise
    """
    path = Path(path).expanduser().resolve()

    if path.exists():
        return os.access(path, os.W_OK)
    else:
        # Check parent directory if path doesn't exist
        parent = path.parent
        return parent.exists() and os.access(parent, os.W_OK)

codewiki.cli.utils.fs.cleanup_directory.source_code:
def cleanup_directory(path: Path, keep_hidden: bool = True):
    """
    Clean up a directory by removing its contents.

    Args:
        path: Directory to clean
        keep_hidden: Keep hidden files/directories (starting with .)

    Raises:
        FileSystemError: If cleanup fails
    """
    path = Path(path).expanduser().resolve()

    if not path.exists():
        return

    try:
        for item in path.iterdir():
            if keep_hidden and item.name.startswith('.'):
                continue

            if item.is_file():
                item.unlink()
            elif item.is_dir():
                shutil.rmtree(item)
    except Exception as e:
        raise FileSystemError(f"Cannot clean directory {path}: {e}")

codewiki.cli.utils.repo_validator.check_.source_code:
def check_writable_output(output_dir: Path) -> Path:
    """
    Check if output directory is writable.

    Args:
        output_dir: Output directory path

    Returns:
        Validated output directory path

    Raises:
        RepositoryError: If output directory is not writable
    """
    output_dir = Path(output_dir).expanduser().resolve()

    # Check if output directory exists
    if output_dir.exists():
        if not output_dir.is_dir():
            raise RepositoryError(
                f"Output path exists but is not a directory: {output_dir}"
            )

        # Check if writable
        if not os.access(output_dir, os.W_OK):
            raise RepositoryError(
                f"Output directory is not writable: {output_dir}\n\n"
                f"Try: chmod u+w {output_dir}"
            )
    else:
        # Check if parent is writable
        parent = output_dir.parent
        if not parent.exists():
            raise RepositoryError(
                f"Parent directory does not exist: {parent}"
            )

        if not os.access(parent, os.W_OK):
            raise RepositoryError(
                f"Cannot create output directory (parent not writable): {parent}\n\n"
                f"Try: chmod u+w {parent}"
            )

    return output_dir

codewiki.cli.utils.validation.validate_o.source_code:
def validate_output_directory(path: str) -> Path:
    """
    Validate output directory path.

    Args:
        path: Directory path to validate

    Returns:
        Validated Path object

    Raises:
        ConfigurationError: If path is invalid
    """
    if not path or not path.strip():
        raise ConfigurationError("Output directory cannot be empty")

    try:
        resolved_path = Path(path).expanduser().resolve()

        # Check if path is writable (or parent is writable if path doesn't exist)
        if resolved_path.exists():
            if not resolved_path.is_dir():
                raise ConfigurationError(
                    f"Output path exists but is not a directory: {path}"
                )

        return resolved_path
    except Exception as e:
        raise ConfigurationError(f"Invalid output directory path: {path}\nError: {e}")

