  //    'Napi::Env' and 'Napi::Env')
  //
  // ... occurs when comparing foo.Env() == bar.Env() or foo.Env() == nullptr
  bool operator==(const BasicEnv& other) const {
    return _env == other._env;
  };
  bool operator==(std::nullptr_t /*other*/) const {
    return _env == nullptr;
  };

