static bool ts_lex(TSLexer *lexer, TSStateId state) {
  START_LEXER();
  eof = lexer->eof(lexer);
  switch (state) {
    case 0:
      if (eof) ADVANCE(45);
      ADVANCE_MAP(
        '!', 103,
        '"', 5,
        '#', 17,
        '%', 82,
        '&', 101,
        '\'', 20,
        '(', 48,
        ')', 49,
        '*', 68,
        '+', 74,
        ',', 47,
        '-', 76,
        '.', 108,
        '/', 79,
        '0', 123,
        ':', 58,
        ';', 46,
        '<', 54,
        '=', 60,
        '>', 89,
        '?', 69,
        '@', 57,
        '[', 52,
        ']', 53,
        '^', 98,
        '{', 50,
        '|', 95,
        '}', 51,
        '~', 104,
